import React from 'react'

import backgroundImage from '../img/marblequarry.jpg'

const headerStyle = {
    backgroundImage: "url(' + '../img/marblequarry.jpg' + ')",
    backgroundSize: 'cover',
    height: '94vh',
    width: '100%'
}

const Header = () => {

    return (
            <header>
                <div
                  class="bg_img"
                  style={{
                    backgroundImage: "url(' + '../img/marblequarry.jpg' + ')",
                  }}>
                    <div class="header__logo">
                        <img src="../img/FP-13.png" alt="Fragment Pur logo" class="logo-black" />
                    </div>
                </div>
            </header>
    )
}

export default Header
